import { Text, View, TouchableOpacity } from "react-native";
import { styles } from "../../style/style";
import React from "react";
// service
import { NavigationService } from "../../service/NavigationService";
import AsyncStorage from "@react-native-async-storage/async-storage";
import { Users } from "../../models/users";
// models

export default function Menu({ navigation }) {
  let user = new Users();
  const navigationService = new NavigationService();

  const _retrieveData = async () => {
    try {
      const value = await AsyncStorage.getItem("@Ensayo:key");
      if (value !== null) {
        // We have data!!
        console.log(JSON.parse(value));
      }
    } catch (e) {
      // Error retrieving data
      console.log(e);
    }
  };

  _retrieveData();
  return (
    <View style={styles.container}>
      <Text style={styles.title}>Bienvenido</Text>
      <Text style={styles.text}>Selecciona una opci√≥n</Text>
      <TouchableOpacity
        style={styles.button}
        onPress={() => {
          navigationService.navigateProductsForm({ navigation });
        }}
      >
        <Text>Products</Text>
      </TouchableOpacity>
      <TouchableOpacity
        style={styles.button}
        onPress={() => {
          navigationService.navigateSaleForm({ navigation });
        }}
      >
        <Text>Sale</Text>
      </TouchableOpacity>
      <TouchableOpacity
        style={styles.button}
        onPress={() => {
          navigationService.navigateUsersList({ navigation });
        }}
      >
        <Text>Users</Text>
      </TouchableOpacity>
      <TouchableOpacity
        style={styles.subtitle}
        onPress={() => {
          navigationService.logout({ navigation });
        }}
      >
        <Text>Cerrar Sesion</Text>
      </TouchableOpacity>
    </View>
  );
}
